import React, {Component} from 'react';
import Form from './Form';
import Listavideos from './Listavideos';





class Page1 extends Component {
	constructor(props){
    super(props);
    this.state = {  };
  }

	onVideoSelect = (video )=>{
    this.setState({selectedVideos:this.state.video});
    
  };		

	render(){
		return(
			<div>
				<Form className="App" render={(routeProps)=> <Form {...routeProps} onFormSubmit={this.handleSubmit}/> } />
        		<Listavideos videos={this.state.videos} onVideoSelect={this.onVideoSelect} />
			</div>


			)
	}
}
export default Page1;
